import React, { Component } from 'react';



class DataGeneral extends Component {

  render() {
    const json = {"home": {
        "instanceName": "HomePage_031219",
        "ciid": "16840624",
        "type": "home",
        "name": "HomeMultiSimple"}};


    return (
      <div className="DataGeneral" dataprops={json}>
        <small>DataGeneral</small>
      </div>
    );
  }
}

export default DataGeneral;
